PHP_MINFO_FUNCTION(in_memoriam)
{
	php_info_print_table_start();
	php_info_print_table_header(1, "Beloved former colleagues");
	php_info_print_table_end();

    php_info_print_table_start();
	php_info_print_table_header(3, "Name", "From", "Until");
	php_info_print_table_row(3, "Martin Waury", "09/2012", "10/2014");
	php_info_print_table_row(3, "Sascha Seyfert", "11/2009", "01/2017");
	php_info_print_table_row(3, "Marcel Fuehrer", "04/2013", "05/2017");
	php_info_print_table_row(3, "Patrick Paechnatz", "01/2014", "06/2017");
	php_info_print_table_row(3, "Tommy Muehle", "04/2010", "06/2017");
	php_info_print_table_end();
}

